import React from 'react'

const Navbar = ({title, icon}) => {
    return (
        <div className='navbar bg-primary'>
            <h1>
                <i className={icon} /> {title}
            </h1>

        </div>
    )
}

Navbar.defaultProps = {
    title: 'Contact Keeper',
    icon: 'fa fa-address-book'
}
export default Navbar
